import React from 'react'
import ReactDom from "react-dom"

class Test  extends React.Component{




    render() {
        return(<div><TableHead/><TableData/></div>)
    }

}

class TableData extends React.Component{



    constructor(){
        super()
        this.state={
             updateView:function(val){
                 return val;

             },
            item:"Date",
            data:[]
         }
         this.setStateHandler=this.setStateHandler.bind(this);


    }

    setState() {

            this.state.data[0]=this.state.item;
            for(let x of this.state.data[0]){
                document.getElementById("test_state").value=this.state.updateView(x);
            }

         }
        render() {
            return (<div><input id="test_state" type="text"/> <input type="button" value="State" onClick={this.setState}/></div>);
        }

}
TableData.defaultProps={

    tool:"Dagger",
    vehicle:"Amore"
}


class TableHead extends React.Component{

    render() {
        return(<div><tbody><tr><th>Head</th><th>Nose</th></tr></tbody></div>);
    }

}
class Heading extends React.Component{

    render() {
        return(<div>Movie Vegas</div>);
    }

}


export default TableData;
